export default {
	getPageId: async() => {
		const searchRes = await api_getPageId.run()
		return searchRes.query.search[0].pageid
	},

	getEntityId: async () => {
		const entityIdRes = await api_getEntityId.run()
		const entityId = entityIdRes.query.pages[appsmith.store.selectedBirdId].pageprops.wikibase_item
		await storeValue("selectedBirdEntityId", entityId)
		return entityId
	},

	getTextData: async() => {
		const textDataRes = await api_getTextInfo.run()
		const text = textDataRes.query.pages[appsmith.store.selectedBirdId.toString()].extract
		console.log(text)
		return text
	},

	getImgTitle: async () => {
		const imgTitleRes = await api_getImgTitle.run()
		const imgTitle = imgTitleRes.claims.P18[0].mainsnak.datavalue.value
		await storeValue("selectedBirdImgTitle", imgTitle)
		return imgTitle
	},

	getImgUrl: async () => {
		const imgUrlRes = await getImgUrl.run()
		const imgUrl = imgUrlRes
		await storeValue("selectedBirdImgUrl", imgUrl)
		return imgUrl
	}
}
